import React from 'react';

export default function NavBar() {
  return (
    <section id='Header'>
        <div className="container">
            <div className="row">
                <div className="col-md-12">
                    <nav className='navbar navbar-expend-lg'>
                        <a href="#" className='navbar-brand'>MyShop</a>
                        <ul className='navbar-nav'>

                        </ul>
                    </nav>
                </div>
            </div>
        </div>
    </section>
  );
}
